import React, { useState } from 'react'
import uniqid from 'uniqid';

export default function Cards() {
    const [state, setState] = useState([
        {
            image: 'https://static.wikia.nocookie.net/chainsaw-man/images/2/23/Power.png/revision/latest/scale-to-width-down/100?cb=20181222132158',
            name: 'Power',
            status: 'not clicked'
        },
        {
            image: 'https://static.wikia.nocookie.net/chainsaw-man/images/9/91/Himeno.png/revision/latest/scale-to-width-down/100?cb=20190324082138',
            name: 'Himeno',
            status: 'not clicked'
        },
        {
            image: 'https://static.wikia.nocookie.net/chainsaw-man/images/6/69/Kobeni.png/revision/latest/scale-to-width-down/100?cb=20190324082457',
            name: 'Kobeni',
            status: 'not clicked'
        },
        {
            image: 'https://static.wikia.nocookie.net/chainsaw-man/images/c/c9/Makima_Control.png/revision/latest/scale-to-width-down/100?cb=20220814145044',
            name: 'Makima',
            status: 'not clicked'
        },
        {
            image: 'https://static.wikia.nocookie.net/chainsaw-man/images/0/09/Reze.png/revision/latest/scale-to-width-down/100?cb=20221129173323',
            name: 'Reze',
            status: 'not clicked'
        },
        {
            image: 'https://static.wikia.nocookie.net/chainsaw-man/images/c/c6/Quanxi.png/revision/latest/scale-to-width-down/100?cb=20200505104152',
            name: 'Quanxi',
            status: 'not clicked'
        },
        {
            image: 'https://static.wikia.nocookie.net/chainsaw-man/images/0/0f/Sawatari.png/revision/latest/scale-to-width-down/100?cb=20190623143448',
            name: 'Akane',
            status: 'not clicked'
        },
        {
            image: 'https://static.wikia.nocookie.net/chainsaw-man/images/4/43/Asa_Mitaka.png/revision/latest/scale-to-width-down/97?cb=20220827182550',
            name: 'Asa',
            status: 'not clicked'
        },
        {
            image: 'https://static.wikia.nocookie.net/chainsaw-man/images/b/b5/Yuko.png/revision/latest/scale-to-width-down/117?cb=20220827191207',
            name: 'Yuko',
            status: 'not clicked'
        },
    ]);


  return (
    <div>
                {state.map (card => {
                <div key={uniqid()}>
ASDASD
                </div>
            })}
    </div>
  )
}
